import React from 'react';
import styled from 'styled-components';
import '../../App.css';
import Drapable from '../Drapable';
import Dropable from '../Dropable';
import { Image } from 'react-bootstrap';

const Wrapper = styled.div`
    width:100%;

    display:flex;
    justify-content:center;

`;
const Item = styled.div`
    padding:8px;
    color:#555;

    border-radius:3px;
    width:250px;


`;
const dropableStyle = {
    backgroundColor: '#260026',
    width: '100%',
    height: '100%',
    position: 'fixed',
    display: 'flex'



};
const dropableStyle1 = {
    height: '100%',
    position: 'absolute',
    bottom: '0',
    right: '0',
    zindex: '990',
    background: '#380028',
    width: '280px',


};
export default class DndTest extends React.Component {
    render() {
        return (
            <Wrapper>
                <Dropable id='dr1' style={dropableStyle}>
                </Dropable>
                <Dropable id='dr2' style={dropableStyle1}>
                    <Drapable style={{ height: '100px', width: '100px', display: "flex", justifyContent: 'flex-start', alignItems: 'center' }}>
                        <Item style={{ margin: '8px' }}>
                            <Image id='item1' src={'/img/3.svg'} className='img' />
                        </Item>
                        <h3 style={{ color: '#d79f47', justifyContent: 'center', display: 'flex' }}>air</h3>
                    </Drapable>
                    <Drapable id='item2'>
                        <Item style={{ margin: '8px' }}>Some other text</Item>
                    </Drapable>
                </Dropable>
            </Wrapper >
        );
    }
}
